import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-2b49bc9b5d852",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\project_folder\\vgovzcBlog\\docs\\README.md").then(comp => {
        Vue.component("v-2b49bc9b5d852", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-26bd8bf3a5eed",
    path: "/accumulate/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\project_folder\\vgovzcBlog\\docs\\accumulate\\README.md").then(comp => {
        Vue.component("v-26bd8bf3a5eed", comp.default)
        next()
      })
    }
  },
  {
    path: "/accumulate/index.html",
    redirect: "/accumulate/"
  },
  {
    name: "v-e98b13c8fe44a",
    path: "/algorithm/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\project_folder\\vgovzcBlog\\docs\\algorithm\\README.md").then(comp => {
        Vue.component("v-e98b13c8fe44a", comp.default)
        next()
      })
    }
  },
  {
    path: "/algorithm/index.html",
    redirect: "/algorithm/"
  },
  {
    name: "v-ebe16e49af23a",
    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\project_folder\\vgovzcBlog\\docs\\guide.md").then(comp => {
        Vue.component("v-ebe16e49af23a", comp.default)
        next()
      })
    }
  },
  {
    name: "v-b3784162247bd",
    path: "/others/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("D:\\project_folder\\vgovzcBlog\\docs\\others\\README.md").then(comp => {
        Vue.component("v-b3784162247bd", comp.default)
        next()
      })
    }
  },
  {
    path: "/others/index.html",
    redirect: "/others/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
